import React, { useContext, useState } from 'react';
import { Link } from 'react-router-dom';
import { AppContext } from '../context/AppContext';
import { Card, Button, Badge, Spinner, Alert } from 'react-bootstrap';

const Product = ({ product }) => {
  const { state, addToCart } = useContext(AppContext);
  const { userInfo } = state;
  const [qty, setQty] = useState(1);
  const [imgError, setImgError] = useState(false);
  const [isAddingToCart, setIsAddingToCart] = useState(false);
  const [cartError, setCartError] = useState(null);

  // Local fallback image
  const fallbackImage = '/images/product-placeholder.jpg';

  const handleAddToCart = async () => {
    try {
      setIsAddingToCart(true);
      setCartError(null);
      await addToCart(product, Number(qty));
    } catch (err) {
      setCartError(err.message || 'Failed to add to cart');
    } finally {
      setIsAddingToCart(false);
    }
  };

  const handleImageError = (e) => {
    setImgError(true);
    e.target.src = fallbackImage;
  };

  return (
    <Card className="h-100 shadow-sm product-card">
      <div className="text-center p-3" style={{ height: '200px', backgroundColor: '#f8f9fa' }}>
        <Card.Img
          variant="top"
          src={imgError ? fallbackImage : product.image}
          style={{ 
            maxHeight: '100%', 
            width: 'auto', 
            objectFit: 'contain',
            mixBlendMode: imgError ? 'luminosity' : 'normal'
          }}
          onError={handleImageError}
          alt={product.name}
          loading="lazy"
        />
      </div>
      <Card.Body className="d-flex flex-column">
        <Card.Title className="mb-2 fs-6">{product.name}</Card.Title>
        
        <Card.Text className="text-muted small mb-2" style={{ flexGrow: 1 }}>
          {product.description.length > 100 
            ? `${product.description.substring(0, 100)}...` 
            : product.description}
        </Card.Text>

        <div className="d-flex justify-content-between align-items-center mb-3">
          <h5 className="mb-0 text-primary">
            ${product.price.toFixed(2)}
            {product.countInStock <= 10 && product.countInStock > 0 && (
              <span className="text-danger small ms-2">
                (Only {product.countInStock} left!)
              </span>
            )}
          </h5>
          
          {product.countInStock > 0 ? (
            <Badge bg="success" pill>In Stock</Badge>
          ) : (
            <Badge bg="secondary" pill>Out of Stock</Badge>
          )}
        </div>
        
        {cartError && (
          <Alert variant="danger" className="py-1 mb-2">
            {cartError}
          </Alert>
        )}

        {userInfo && product.countInStock > 0 && (
          <div className="mt-auto">
            <div className="input-group mb-2">
              <input
                type="number"
                min="1"
                max={product.countInStock}
                value={qty}
                onChange={(e) => setQty(Math.max(1, Math.min(product.countInStock, e.target.value)))}
                className="form-control"
                aria-label="Quantity"
              />
              <Button
                variant="primary"
                onClick={handleAddToCart}
                disabled={isAddingToCart}
              >
                {isAddingToCart ? (
                  <>
                    <Spinner
                      as="span"
                      animation="border"
                      size="sm"
                      role="status"
                      aria-hidden="true"
                      className="me-2"
                    />
                    Adding...
                  </>
                ) : (
                  'Add to Cart'
                )}
              </Button>
            </div>
          </div>
        )}
        
        {userInfo?.isAdmin && (
          <Link
            to={`/admin/product/${product._id}/edit`}
            className="btn btn-outline-secondary btn-sm mt-2"
          >
            Edit Product
          </Link>
        )}
      </Card.Body>
    </Card>
  );
};

export default Product;
